import React from 'react';
import { Link } from 'react-router-dom';
import styles from './Header.module.css'

function Header(color) {
  console.log(color.props)
  return (
    <div className={styles.header}>
      <div className={styles.mainLogo}>
        <Link to='/twice'>
          <img src="https://lv2-cdn.azureedge.net/twice/6288050c2dfa46bd8688db2853cb7607-logo-wh.png" alt="logo" />
        </Link>    
      </div>
      <div className={`menu-toggle ${styles.menuToggle}`}>
        <img src="https://twice.jype.com/Content/Pc/images/common/menu.png" alt="logo" />
      </div>  
    </div>
  );
}

export default Header;
